@objc(GridSampleLayer)
final class GridSampleLayer: NSObject, MLCustomLayer {
    let padding_mode: Int
    let align_corners: Bool
    
    required init(parameters: [String : Any]) throws {
        print(#function, parameters)
        if let padding_mode = parameters["padding_mode"] as? Int {
              self.padding_mode = padding_mode
            } else {
              self.padding_mode = 0
            }
        if let align_corners = parameters["align_corners"] as? Bool {
              self.align_corners = align_corners
            } else {
              self.align_corners = false
            }

    func setWeightData(_ weights: [Data]) throws {
    print(#function, weights)
  }

  func outputShapes(forInputShapes inputShapes: [[NSNumber]]) throws 
       -> [[NSNumber]] {
    print(#function, inputShapes)
    return inputShapes
  }

  func evaluate(inputs: [MLMultiArray], outputs: [MLMultiArray]) throws {
    print(#function, inputs.count, outputs.count)
    print(self.padding_mode, self.align_corners)
  }
}
